        await axios({
            method : 'get',
            url : 'http://127.0.0.1:8000/auth/login/',
            headers: { Authorization:localStorage.getItem('SavedToken') }
        }).then((response) => {
            console.log(response.data)
            setUser(response.data)
        })

    const submit_data = (event) => {
        event.preventDefault()
        get_user()
    }
    return(
        <>
         <h1> Datas </h1>
        </>
    )
}
}

